n ViewAll button\n    Then I verify product listing page loaded\n    When I search for an '<item>' from search field\n    And I add two products to the cart\n    Then I find the cart count is '<cartCount>'\n    \n    Examples:\n    |item|cartCount|\n    |REDMI|2|\n    \n  @smoke\n  Scenario Outline: Verify Delete from Cart functionality\n    Given I launch the app '<shoppingApp>'\n    And I find the homepage loaded\n    When I click on ViewAll button\n    Then I verify product listing page loaded\n    When I search for an '<item>' from search field\n    And I add two products to the cart\n    Then I find the cart count is '<cartCount>'\n    When I delete one product from the cart\n    Then I verify cart count is decreased to 1\n    \n    Examples:\n    |item|cartCount|\n    |REDMI|2|\n\n    @demo\n    Scenario: I verify regex for cucumber scenario\n      Given I have a fruit \"apple\" whose price is 100\n      And I have a vegetable \"tomato\" whose price is 200\n      When I sell it in the shop\n      Then I get double the price 200","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/thoudi/repos/cucumberbdd2022/./src/test/resources/features/flipkart_home.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Test123","id":"d69025ae-20c9-4971-839c-6230cef6cf0d"}],"language":"en","keyword":"Feature","name":"Homepage scenarios","description":"","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[{"location":{"line":4,"column":3},"name":"@smoketest123","id":"f4a63d94-6af8-4b1c-8f2f-8225754105d0"}],"keyword":"Scenario","name":"Verify ViewAll button on the homepage","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","text":"I launch the app '<shoppingApp>'","id":"87c1b920-05b5-4d44-b808-662a1663d0c1"},{"location":{"line":7,"column":5},"keyword":"And ","text":"I find the homepage loaded","id":"deb99eba-0412-4dc0-a187-79f35d13f41a"},{"location"
